}
resource "aws_s3_bucket_versioning" "exampleBucketVersioning" {  
    bucket = aws_s3_bucket.exampleBucket.id  //replace this value by the id of your S3 Bucket you want to enable version control for (you can get it from terraform output) e.g., ${aws_s3_bucket.exampleBucket.id}
    mode   = "Enabled"                      //default is Enabled, other options are Disabled or Suspended 
}  
resource "aws_s3_bucket_encryption" "enableEncryptionAtRest" {    
 bucket = aws_s3_bucket.exampleBucket.id    //replace this value by the id of your S3 Bucket you want to enable encryption at rest for (you can get it from terraform output) e.g., ${aws_s3_bucket.exampleBucket.id}
  server_side_encryption_configuration {  
    rule {    
