provider "aws" {
  region = "us-west-2"
}

resource "aws_iam_role" "ec2_s3_reader" {
  name        = var.role_name
  description = "EC2 role for reading from S3"

  assume_role_policy = jsonencode({
    Version = "2012-10-17"
    Statement = [
      {
        Action = "sts:AssumeRole"
        Effect = "Allow"
        Principal = {
          Service = "ec2.amazonaws.com"
        }
      },
    ]
  })
}

