Here is the Terraform configuration that generates a safe, minimal Infrastructure-as-Code (IaC) solution for launching an AWS RDS PostgreSQL instance in multi-AZ mode with automated backups retained for 7 days:
```
provider "aws" {
  region = "us-west-2"
}

resource "aws_rds_instance" "example" {
  name        = "my-rds-instance"
  engine      = "postgres"
  instance_class = "db.t2.micro"

  vpc_security_group_ids = [aws_security_group.example.id]

  tags = {
    Name = "My RDS Instance"
  }
}

resource "aws_security_group" "example" {
  name        = "my-rds-sg"
  description = "Security group for RDS instance"

  ingress {
    from_port   = 5432
    to_port     = 5432
    protocol    = "tcp"
    cidr_blocks = ["0.0.0.0/0"]
  }

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }
}

resource "aws_rds_backup_group" "example" {
  name        = "my-rds-backup-group"
  description = "Backup group for RDS instance"

  vpc_security_group_ids = [aws_security_group.example.id]

  tags = {
    Name = "My Backup Group"
  }

  retention_window {
    days = 7
  }
}

resource "aws_rds_instance_version" "example" {
  name        = "my-rds-instance-version"
  instance_id = aws_rds_instance.example.id

  depends_on = [aws_rds_backup_group.example]
}

output "instance_url" {
  value = aws_rds_instance.example.endpoint
}
```
This Terraform configuration defines:

1. An AWS RDS instance with the specified engine, instance class, and security group.
2. A security group for the RDS instance with inbound traffic on port 5432 from any IP address.
3. A backup group for the RDS instance with a retention window of 7 days.
4. Two resources: `aws_rds_instance` and `aws_rds_backup_group`, which are dependencies of each other.

The output variable `instance_url` returns the endpoint URL of the RDS instance, which can be used to connect to the database.

